import { Component } from '@angular/core';

@Component({
  selector: 'app-join-room',
  templateUrl: './join-room.component.html',
  styleUrls: ['./join-room.component.css']
})
export class JoinRoomComponent {
  public user: string = '';
  public userName: string= '';
public roomCode: string = '';
}
<div class="container">
    <img src="../../assets/images/bg.jpeg" alt="background image" style="width:100%;">
    <div class="centered">
        <div class="circle-container" >
            <img src="" alt="Photo"> {{ userName}}
            <p class = "user">{{ user }}</p>
        </div>
        <label for="html">Type room code below</label><br>
            <input type = "text" placeholder="-Type-" class = "playerRoom2"  [(ngModel)]="roomCode"><br>
            <button class = "createBtn"  [disabled]="!roomCode" [ngClass]="{'enabled': roomCode}" >Create</button>

    </div>   
</div>
